PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "posts" ("id" serial PRIMARY KEY  NOT NULL, "name" varchar(255), "title" varchar(255), "content" text, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "models" ("id" INTEGER PRIMARY KEY  NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY  NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "first_name" varchar(255), "last_name" varchar(255), "profile_image_url" varchar(255));
CREATE TABLE "teams" ("id" serial PRIMARY KEY  NOT NULL, "name" varchar(255), "school" varchar(255), "year" integer, "seed" integer, "region" varchar(255), "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "user_team_id" integer, "round_drafted" integer, "wins" integer, "eliminated" boolean);
CREATE TABLE "user_teams_users" ("user_team_id" integer, "user_id" integer);
CREATE TABLE "user_teams" ("id" serial PRIMARY KEY  NOT NULL, "name" varchar(255), "year" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "draft_position" integer);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_models_on_email" ON "models" ("email");
CREATE UNIQUE INDEX "index_models_on_reset_password_token" ON "models" ("reset_password_token");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
COMMIT;
